import React from 'react';
import logo from '../assets/jay.png'; 
import '../mycss/Footer.css';

function Footer() {
  return (
    <footer className="footerbox">
      <div className="footer-content">
        <div className="footer-logo">
          <img src={logo} alt="Logo" width="150"/>
        </div>

        <div className="footer-text">
          <p>© 2024 Jayce Turambe Website. All rights reserved.</p>
          <p>Remember to connect with me!</p>
        </div>
      </div>

      <div className="footer-linkedin">
        <a href="https://www.linkedin.com/in/Jayce90" rel="noopener noreferrer">
          linkedin
        </a>
      </div>

      <di className="footer-github">
        <a href="https://github.com/Jaycee90" rel="noopener noreferrer">
          github
        </a>
      </di>
    </footer>
  );
}

export default Footer;
